INSERT INTO blogv2.tbl_blog (BlogId, Content, CreatedAt, Title, UpdatedAt, ImgId, UserId) VALUES (8, '<p>Mở đầu buổi họp báo sau trận, ông Dastgir nhận xét: "Đây là một trận đấu hay, mãn nhãn với người hâm mộ. Chúng tôi dù thua nhưng đã tạo ra khá nhiều cơ hội. Nếu có được bàn thắng thì mọi chuyện đã khác. Còn Việt Nam thì họ đã ghi bàn. Tôi nghĩ họ xứng đánh giành chiến thắng".</p><p>Khi được yêu cầu đánh giá về lối chơi của tuyển Việt Nam, HLV Dastgir đã gây bất ngờ khi nhắc tới 2 ngôi sao lớn trên thế giới là Cristiano Ronaldo và Lionel Messi.</p><p>Ông phát biểu: "Tuyển Việt Nam đã phát triển trong thời gian qua, họ đá rất hay. Thủ môn của họ cũng rất tốt, nhìn chung mọi cầu thủ đều chơi ổn. Thế mạnh của Việt Nam là sức mạnh tập thể, chứ họ không dựa dẫm vào một ngôi sao duy nhất như Ronaldo, Messi. Đó là điều tốt cho tuyển Việt Nam".</p><p>Sắp tới, tuyển Afghanistan sẽ bước vào vòng loại thứ 3 AFC Asian Cup 2023. Dù không được đánh giá cao, nhưng HLV Anoush Dastgir vẫn hy vọng sẽ giúp được cho đội bóng của mình vượt qua khó khăn và góp mặt ở vòng chung kết.</p><p>"Ở các trận giao hữu trước, chúng tôi đã chơi tốt và quyết tâm. Hôm nay gặp tuyển Việt Nam chúng tôi đã tạo ra nhiều cơ hội. Tôi nghĩ chất lượng đội hình của chúng tôi là khá tốt, ngang bằng với Việt Nam. Tôi tin Afghanistan sẽ vượt qua được vòng loại và có lần đầu tiên góp mặt tại Asian Cup, giống như Việt Nam từng làm".</p>', '2022-06-01 23:09:08.407000', 'HLV Afghanistan: ''Việt Nam không lệ thuộc vào một ngôi sao như Ronaldo, Messi''', '2022-06-01 23:09:08.407000', 11, 1);
INSERT INTO blogv2.tbl_blog (BlogId, Content, CreatedAt, Title, UpdatedAt, ImgId, UserId) VALUES (9, '<p>Thời điểm chụp hình và phỏng vấn cho Rolling Stone, sức khoẻ của Jisoo không thực sự ổn định vì mất ngủ. Cô nàng chia sẻ sẽ phải đến bệnh viện kiểm tra vì chân đã đau trong 1 tháng. Điều đó làm chị cả BLACKPINK lo lắng vì phải tập vũ đạo cho lần comeback sắp tới của nhóm:</p><p><em>"Tôi không ổn lắm. Đêm qua tôi không ngủ ngon, đúng ra là tôi chỉ mới thiếp đi vào tầm 8 giờ sáng nay. Sau buổi phỏng vấn này tôi sẽ phải đến bệnh viện để kiểm tra vì chân tôi bị đau. Tôi bị va mạnh chân vào cánh cửa, tuy không bị gãy xương nhưng nó cứ đau mãi suốt 1 tháng qua nên tôi phải đi chụp X-quang.</em></p><p><em>Cũng may là BLACKPINK chưa thu âm xong nên tôi chưa cần hoạt động chân nhiều. Tôi mong mình có thể bình phục trước lúc tập luyện vũ đạo cho đợt comeback này".</em></p><p>Nếu như Jennie, Rosé và Lisa chưa nghĩ đến tương lai có một ngày BLACKPINK sẽ tan rã thì Jisoo lại khác, cô nàng đã có cho mình một kế hoạch nếu ngày này thực sự xảy ra.</p><p><br></p><p><em>"Kể cả không phải Hawaii thì tôi cũng luôn nghĩ đến việc chuyển ra nước ngoài. Tôi vốn là một người có tâm hồn tự do ngay từ khi còn ngồi trên ghế nhà trường. Nếu mọi người hỏi tôi ''Bạn định sống như thế nào?'', tôi nghĩ mình sẽ trả lời: ''Nếu không thể kiếm được công việc thích hợp, tôi sẽ nhận hợp đồng biểu diễn part-time, bám lấy bố mẹ và ở nhà với họ. Tôi có thể tiết kiệm tiền để đi chơi và bằng cách nào đó, tôi sẽ tìm ra điều mình muốn làm. Khi 1 cánh cửa đóng lại, một cánh cửa khác sẽ mở ra mà".</em></p><p><br></p><p>Với âm nhạc, dù&nbsp;<a href="https://kenh14.vn/jisoo-blackpink-noi-ve-ap-luc-khi-solo-viec-bieu-dien-doi-khi-giong-nhu-mot-bai-kiem-tra-hon-la-mot-thu-gi-do-vui-ve-20220523210108184.chn" rel="noopener noreferrer" target="_blank">chưa hoạch định được bản thân thực sự muốn gì trong màn solo</a>&nbsp;của riêng mình thì Jisoo vẫn luôn nuôi đam mê cháy bỏng.&nbsp;Âm nhạc có ý nghĩa to lớn đối với Jisoo:</p><p><em>"Tôi yêu thứ âm nhạc mà chúng tôi đang làm. Nếu không có niềm yêu thích đó thì sẽ rất khó để tiếp tục. Tôi nghĩ mọi thứ trở nên có ý nghĩa hơn khi chúng tôi bắt đầu học cách tạo ra thứ âm nhạc của riêng mình.</em></p><p><em>Làm thế nào để tôi có thể ảnh hưởng tốt hơn đến cuộc sống của người khác thông qua âm nhac? Tôi hy vọng âm nhạc của BLACKPINK sẽ giúp mọi người vượt qua những khó khăn và quên đi điều phiền muộn, giống như cách mà âm nhạc đã giúp tôi.</em></p>', '2022-06-01 23:11:25.778000', 'Jisoo bị đau chân suốt một tháng, đã có kế hoạch sau khi BLACKPINK tan rã', '2022-06-01 23:11:25.778000', 12, 1);
INSERT INTO blogv2.tbl_blog (BlogId, Content, CreatedAt, Title, UpdatedAt, ImgId, UserId) VALUES (10, '<p>Chưa đi Kon Tum thì nghĩ nơi đây chắc sẽ không nhộn nhịp và thú vị như Đà Lạt. Nhưng đến rồi mới thấy Kon Tum không chỉ mang một nét đẹp hoang dã của thiên nhiên núi rừng, sự ấm áp từ lòng hiếu khách của người dân, mà còn có cả một nền ẩm thực phong phú với các món ăn đặc sắc và hấp dẫn, đủ chất liệu cho bạn làm vài clip foodtour lên ngay xu hướng trên "tóp tóp" luôn đấy!</p><p><strong>Xôi măng</strong></p><p>Đừng tìm bánh mì xíu mại, bánh căn hay phở cuốn cho buổi sáng ở KonTum. Bạn nên thử ngay món xôi măng nếu muốn thưởng thức bữa sáng đậm đà phố núi. Món xôi măng của người Kon Tum mang hương vị chua chua cay the của măng rừng được xào vừa chín, hòa quyện với vị ngọt bùi của xôi nếp vừa thơm vừa dẻo. Ở một số hàng quán, xôi măng còn có thêm topping là cá kho hay đậu hủ kho càng làm món xôi trở nên đậm vị hơn. Chỉ với mức giá từ 10 nghìn đồng, xôi măng sẽ khiến bạn "no căng bụng" và xao xuyến không thôi.</p><p><strong>Gỏi lá Kon Tum</strong></p><p>Các tín đồ ẩm thực thường truyền tai nhau: đến Kon Tum mà chưa ăn thử gỏi lá thì coi như bỏ phí một món ngon trên đời vì món gỏi lá này hấp dẫn thực khách cả ở nguyên liệu, nước chấm lẫn cách thưởng thức.</p><p><span style="color: rgb(34, 34, 34);">Topping chính của món gỏi lá gồm có thịt ba chỉ luộc, tôm và bì lợn kèm muối, hạt tiêu sọ đen và ớt xanh. Nhưng nguyên liệu "chiếm spotlight" lại là hơn 30 loại lá ăn kèm phải kể đến như lá mơ, đinh lăng, cải, sung, tía tô, kinh giới, húng quế đến các loại đặc trưng của núi rừng Tây Nguyên như lá trâm, mật gấu, tơ-nuy, lá bửa, hồng ngọc… Nước chấm chuẩn vị phải được làm từ gạo nếp lên men, ủ với tôm khô, thịt ba chỉ, sau đó đem đi xay nhuyễn với mẻ, sa tế cùng các gia vị khác tạo nên một hương vị ngây ngất lòng người.</span></p><p><strong><span class="ql-cursor">﻿</span>Gà nướng Măng Đen</strong></p><p>Lọt top 50 món ngon nên thử trong sách kỷ lục Guinness Việt Nam, đặc sản Gà nướng của thị trấn Măng Đen, Kon Tum sẽ làm hài lòng những tín đồ ẩm thực trên khắp mọi nơi. Gà để nướng là loại gà thả vườn, thịt ngon mềm. Sau khi làm sạch sẽ được tẩm ướp gia vị từ một số loại rễ, lá, mật ong và cây rừng đặc trưng ở Kon Tum rồi nướng trên bếp than hồng xoay tròn đến khi chín vàng, cho mùi thơm "nức mũi".</p>', '2022-06-01 23:14:07.240000', 'Nhìn loạt ảnh ẩm thực tại phố núi Kon Tum mà hối hận sao không ghé thăm nơi này sớm hơn', '2022-06-01 23:14:07.240000', 13, 1);


